import WeeklyItems from '../../components/item/WeeklyItems';
import AddWeekly from '../../components/item/AddWeekly'
import Private from '../../components/auth/Private'

const weekly = () => {
    return (
        <Private>
            <Head>
                <title>{APP_NAME}</title>
            </Head>
            <Layout>
                <div className='app'>
                    <div className='app__body'>
                        <AddWeekly />
                        <WeeklyItems  />
                    </div>
                </div>
            </Layout>
        </Private>
    );
};

export default weekly;
